    @Test
    public void ConvertOrderStringToObject_ExpectValidPayload(){
        ObjectConverter oc = MakeObjectConverter();
        CryptsyOrder ce = oc.MakeOrderObject("{\"success\":\"1\",\"orderid\":\"97332445\",\"moreinfo\":\"Your Buy order has been placed for<br><b>20.00000000 POT @ 0.00000100 BTC<\\/b> each.<br>Order ID: <b>97332445<\\/b>\"}");
        
        // Assert
        assertNotNull(ce);
        assertEquals("97332445", ce.orderid);
        assertEquals("Your Buy order has been placed for<br><b>20.00000000 POT @ 0.00000100 BTC</b> each.<br>Order ID: <b>97332445</b>", ce.moreinfo);
    }
    
